import React,{useEffect} from 'react'

export default function Navbar() {


  
    return (
    <div className="navigation-top">
        <a href="/">Home</a>

        <a href="/">Destinations</a>

        <a href="/">Restaurants</a>

        <a href="/">Hotels</a>
        

        <i className="fa fa-bars"></i>

        <style jsx>{`
        
        .navigation-top{
            width:100%;
            height:100%;
            background-color:yellow
        }
        
        .navigation-top a{
            display: block;
            color:white;
            text-align:center;
            text-decoration: none;
            font-size: 5vw;
            padding:10px
        }

       
        `}</style>
        </div>


    )
}
